import { Visible } from './components/context/visible'
import LoginForm from './components/login/LoginForm'


const App = () => {

  const [isVisible, setIsVisible] = useState(false);

  return (
    <div>
      <Visible.Provider></Visible.Provider>
      <Visible.Provider value={
        {
          isVisible,
          setIsVisible
        }
      } >
        <LoginForm />
      </Visible.Provider>
    </div>
  )
}

export default App
